    options: {
        parsing: false,
        interaction: {
                mode: 'x',
                axis: 'x',
                intersect: false
        },
    plugins: {
        zoom: {
            pan: {
                enabled: true,
                mode: 'xy'
            },
            zoom: {
                wheel: {
                    enabled: true
                },
                pinch: {
                    enabled: true
                }
            }
        },
        tooltip: {
            callbacks: {
                label: function(context) {

                    var d = new Date(0);
                    d.setUTCSeconds(context.parsed.x);
                    var label = [d.toLocaleString()];
                    label.push(context.dataset.label + " = " + context.parsed.y);
                    
                    return label;
                }
            }
        }
    },
    scales: {
        x: {
            type: 'linear',
            ticks: {
                callback: function(value, index, values) {
                    var d = new Date(0);
                    d.setUTCSeconds(value);
                    return d.toLocaleString();
                }
            }
        }
    }
    }
  };
  var myChart = new Chart(
    document.getElementById('myChart'),
    config
  );
  const histConfig = {
    type: "bar",
    data: dataHistogram,
    options: {
    plugins: {
        zoom: {
            pan: {
                enabled: true,
                mode: 'xy'
            },
            zoom: {
                wheel: {
                    enabled: true
                },
                pinch: {
                    enabled: true
                }
            }
        }
    }
    }};

  var chart2 = new Chart(
    document.getElementById('histogram'),
    histConfig
  );
  const minmaxConfig = {
    type: "bar",
    data: dataMinmax,
    options: {
    plugins: {
        zoom: {
            pan: {
                enabled: true,
                mode: 'xy'
            },
            zoom: {
                wheel: {
                    enabled: true
                },
                pinch: {
                    enabled: true
                }
            }
        }
    },
    scales: {
        'SLOPE': {
            position: 'left',
            beginAtZero: false
        }
    }
    }};

  var chart3 = new Chart(
    document.getElementById('minmax'),
    minmaxConfig
  );
</script>

</div>
